(57, 'Mango Black Tea', NULL, 'Dehydrated Mango Black Tea is a refreshing blend of premium black tea leaves infused with the tropical sweetness of sun-dried mango', 'mango-black-tea', '<p>Dehydrated Mango Black Tea is a refreshing blend of premium black tea leaves infused with the tropical sweetness of sun-dried mango. This aromatic tea offers a perfect balance of bold, robust flavor and fruity notes, creating a smooth and energizing drink. Rich in antioxidants, it supports wellness while delivering a delightful taste experience. Enjoy it hot or iced for a naturally uplifting beverage that combines health, flavor, and convenience in every sip.</p>', NULL, '678.00', '0.00', 'fixed', NULL, NULL, '1695.00', 0, 100, 0, 0, 1, 1, 46, 0, 1, NULL, NULL, NULL, '2025-08-01 22:56:52', '2025-08-26 17:07:27'),
(58, 'Detox Morning Tea', NULL, 'Dehydrated Detox Morning Tea is a refreshing blend crafted to kickstart your day with natural energy and cleansing benefits', 'detox-morning-tea', '<div><strong data-start=\"104\" data-end=\"136\">Dehydrated Detox Morning Tea</strong> is a refreshing blend crafted to kickstart your day with natural energy and cleansing benefits. Made with carefully selected herbs and botanicals, this tea supports digestion, boosts metabolism, and helps flush out toxins for a lighter, healthier start. Its gentle yet revitalizing flavor makes it the perfect morning ritual. 100% natural, caffeine-free, and preservative-free â€“ your daily step towards wellness and balance.<b></b></div><div><b><br></b></div><div><b>Health Benefits</b></div><div><br></div><ul><li>Gently Detoxifies the Liver and Digestive System\r\n</li><li>Boosts Metabolism and Supports Weight Management\r\n</li><li>Reduces Stress, Anxiety, and Mental Fatigue</li><li>\r\nRich in Antioxidants for Body Cleansing and Immunity\r\n</li><li>Enhances Digestion and Reduces Bloating</li></ul>', NULL, '436.00', '0.00', 'fixed', NULL, NULL, '1090.00', 0, 100, 0, 1, 0, 1, 33, 1, 1, NULL, NULL, NULL, '2025-08-01 22:56:52', '2025-08-25 01:58:39'),
(59, 'Pineapple Black Tea', NULL, 'Dehydrated Pineapple Black Tea is a delightful fusion of bold black tea and the tropical sweetness of pineapple', 'pineapple-black-tea', '<p><strong data-start=\"90\" data-end=\"124\">Dehydrated Pineapple Black Tea</strong> is a delightful fusion of bold black tea and the tropical sweetness of pineapple. This unique blend offers a refreshing taste with a perfect balance of richness and fruity zest. Packed with antioxidants, it helps boost energy, improve focus, and uplift your mood throughout the day. Enjoy it hot or iced for a naturally invigorating experience. 100% pure, natural, and preservative-free â€“ a tropical twist in every sip</p><p><b>Health Benefits</b></p><ul><li>Supports Digestion and Reduces Bloating</li><li>\r\nBoosts Immunity with Vitamin C &amp; Antioxidants\r\n</li><li>Enhances Energy and Mental Alertness</li><li>\r\nPromotes Heart Health\r\n</li><li>Supports Weight Management</li></ul>', NULL, '706.00', '0.00', 'fixed', NULL, NULL, '1765.00', 0, 100, 0, 0, 0, 1, 55, 1, 1, NULL, NULL, NULL, '2025-08-01 22:56:52', '2025-08-25 01:58:39'),
(60, 'Soursop Black Tea', NULL, 'Soursop Black Tea is a natural wellness booster', 'soursop-black-tea', '<p></p><div aria-hidden=\"true\" data-edge=\"true\" class=\"pointer-events-none h-px w-px\"></div><p></p><article class=\"text-token-text-primary w-full focus:outline-none scroll-mt-[calc(var(--header-height)+min(200px,max(70px,20svh)))]\" tabindex=\"-1\" dir=\"auto\" data-turn-id=\"request-WEB:92d95bff-9457-4335-aad5-69647784ea70-4\" data-testid=\"conversation-turn-10\" data-scroll-anchor=\"true\" data-turn=\"assistant\"><div class=\"text-base my-auto mx-auto pb-10 [--thread-content-margin:--spacing(4)] @[37rem]:[--thread-content-margin:--spacing(6)] @[72rem]:[--thread-content-margin:--spacing(16)] px-(--thread-content-margin)\"><div class=\"[--thread-content-max-width:32rem] @[34rem]:[--thread-content-max-width:40rem] @[64rem]:[--thread-content-max-width:48rem] mx-auto max-w-(--thread-content-max-width) flex-1 group/turn-messages focus-visible:outline-hidden relative flex w-full min-w-0 flex-col agent-turn\" tabindex=\"-1\"><div class=\"flex max-w-full flex-col grow\"><div data-message-author-role=\"assistant\" data-message-id=\"317c795b-7603-4f47-855a-affe412e0a43\" dir=\"auto\" class=\"min-h-8 text-message relative flex w-full flex-col items-end gap-2 text-start break-words whitespace-normal [.text-message+&amp;]:mt-5\" data-message-model-slug=\"gpt-4o\"><div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\"><div class=\"markdown prose dark:prose-invert w-full break-words dark markdown-new-styling\"><h2 data-start=\"187\" data-end=\"238\">Soursop Black Tea â€“ Sip the Power of Nature</h2>\r\n<p data-start=\"240\" data-end=\"511\">A bold fusion of premium black tea and nutrient-rich <strong data-start=\"293\" data-end=\"311\">soursop leaves&nbsp;</strong>, this aromatic brew offers more than just great taste. <strong data-start=\"367\" data-end=\"388\">Soursop Black Tea</strong> is a natural wellness booster, rich in antioxidants and traditional