(66, 'Moringa Leaves Powder', 'à¶¸à·”à¶»à·”à¶‚à¶œà· à¶šà·œà·… à¶´à·€à·”à¶©à¶»à·Š', 'Boost your health naturally with our Dehydrated Moringa Leaves Powder', 'moringa-leaves-powder-1', '<p>Boost your health naturally with our <strong data-start=\"129\" data-end=\"165\">Dehydrated Moringa Leaves Powder</strong>, made from carefully dried, nutrient-rich moringa leaves. Packed with vitamins, minerals, antioxidants, and protein, this superfood supports immunity, energy, and overall wellness. Add a spoonful to smoothies, teas, soups, or curries for a natural health boost. 100% pure, with no preservatives or additives, itâ€™s the perfect way to include natureâ€™s powerhouse of nutrition in your daily routine.</p><p><b>Health Benefits</b></p><ul><li>Â Rich in Vitamins A, C, E, and Minerals like Iron and Calcium\r\n</li><li> Boosts Immunity and Fights Infections</li><li>\r\n Supports Brain Function and Mental Clarity\r\n</li><li> Helps Reduce Inflammation and Joint Pain</li><li>\r\n Balances Blood Sugar and Cholesterol Levels</li></ul>', NULL, '500.00', '650.00', 'fixed', '2025-08-12', '2025-10-30', '1000.00', 0, 250, 0, 0, 0, 1, 52, 1, 1, NULL, NULL, NULL, '2025-08-01 22:56:52', '2025-08-25 01:58:39'),
(69, 'Bitter Gourd Powder', 'à¶šà¶»à·€à·’à¶½ à¶´à·€à·”à¶©à¶»à·Š', 'Dehydrated Bitter Gourd Powder is a natural wellness supplement packed with essential nutrients and health benefits', 'bitter-gourd-powder', '<p><strong data-start=\"90\" data-end=\"124\">Dehydrated Bitter Gourd Powder</strong> is a natural wellness supplement packed with essential nutrients and health benefits. Rich in antioxidants, vitamins, and minerals, it supports healthy blood sugar levels, improves digestion, and boosts immunity. This versatile powder can be mixed into smoothies, juices, or warm water for daily wellness. 100% pure, natural, and preservative-free, itâ€™s an easy way to add the powerful benefits of bitter gourd to your healthy lifestyle</p><p><b>Health Benefits</b></p><ul><li>Supports Healthy Blood Sugar Control\r\n</li><li>Aids Digestion and Detoxifies the Body</li><li>\r\nContains Antioxidants That Combat Inflammation\r\n</li><li>May Help Improve Skin Conditions and Immunity<b></b></li></ul>', NULL, '460.00', '0.00', 'fixed', NULL, NULL, '1150.00', 0, 100, 0, 0, 0, 1, 3, 1, 1, NULL, NULL, NULL, '2025-08-01 22:56:52', '2025-08-25 01:58:39'),
(71, 'Blue Butterfly Pea Flower Powder', 'à¶±à·’à¶½à·Šà¶šà¶§à¶»à·œà¶½à·” à¶¸à¶½à·Š à¶´à·€à·”à¶©à¶»à·Š', 'Bring color and wellness to your day with our Dehydrated Blue Butterfly Pea Powder', 'blue-butterfly-pea-flower-powder', '<p>Bring color and wellness to your day with our <strong data-start=\"142\" data-end=\"182\">Dehydrated Blue Butterfly Pea Powder</strong>, made from naturally dried butterfly pea flowers. Rich in antioxidants and known for promoting healthy skin, hair, and relaxation, this vibrant blue powder is perfect for teas, smoothies, desserts, and cocktails. Add lemon to watch its magical color change to purple. 100% pure, caffeine-free, and preservative-free, itâ€™s a natural way to enjoy beauty and wellness in every sip.</p><p><b>Health Benefits</b></p><ul><li>Enhances Cognitive Function &amp; Memory\r\n</li><li> Promotes Eye Health with Rich Anthocyanins</li><li>\r\n Natural Antioxidant &amp; Anti-Aging Support\r\n Supports </li><li>Glowing Skin &amp; Hair Growth\r\n</li><li> Helps Reduce Stress &amp; Improve Mood</li></ul>', NULL, '340.00', '0.00', 'fixed', NULL, NULL, '850.00', 0, 100, 0, 0, 0, 1, 5, 1, 1, NULL, NULL, NULL, '2025-08-01 22:56:52', '2025-08-25 01:58:39'),
(72, 'Insulin Plant Leaf Powder', 'à¶­à·™à¶¹à·” à¶šà·œà·… à¶´à·€à·”à¶©à¶»à·Š', 'Insulin Plant Leaf Powder supports healthy blood sugar levels naturally', 'insulin-plant-leaf-powder', '<p>Insulin Plant Leaf Powder supports healthy blood sugar levels naturally. Rich in antioxidants and dietary fiber, it promotes better digestion and metabolism. Ideal for diabetics, it helps manage insulin function effectively. A natural, herbal supplement for overall wellness and daily health support.</p><p><b>Health Benefits</b></p><ul><li><b>Helps Regulate Blood Sugar Levels Naturally</b></li><li><b>&nbsp;Supports Healthy Cholesterol Levels</b></li><li><b>&nbsp;Improves Digestive Function</b></li><li><b>&nbsp;Aids in Weight Management</b></li><li><b>&nbsp;Promotes Liver Health &amp; Detoxification</b></li></ul>', NULL, '144.00', '0.00', 'fixed', NULL, NULL, '360.00', 0, 100, 0, 0, 0, 1, 40, 1, 1, NULL, NULL, NULL, '2025-08-01 22:56:52', '2025-08-25 01:58:39'),
